webpackJsonp([0x639abc391ccb],{1896:function(a,e){a.exports={data:{markdownRemark:{html:"<p>买了一双布鞋，我们开玩笑说是老八路鞋。现在市场上的东西大大丰富，各式各样，应有尽有，国产的进口的都有。这说明经济已经发达起来，市场也发展起来。但是，从文化来说，仍然不高。市场不仅是销售和堆积大量商品，而是有一整套文化。可能一个社会的经济发展，要做到商品丰富已经不容易，要达到较高的经济文化就更不容易。</p>\n<p>文化更不是突击可以解决的，必须有历史，与民族的精神和文化水平联系在一起。最近的棉花、香烟、酒打假，更让人深深感觉到这一点。如何在物质商品的增长中，使文化也日增夜长，是重大的社会发展问题，这样社会才能平衡地发展。</p>",id:"/home/swain/workspace/political-life/src/pages/zh/0141.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/zh/0141.md",frontmatter:{title:"8月29日 星期一"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/zh/0141.md absPath of file >>> MarkdownRemark"}}}});
